import * as React from 'react';
import { StyleSheet, SafeAreaView, View, Text, TouchableOpacity, TextInput, Button, ImageBackground } from 'react-native';
import { IconButton, Colors } from 'react-native-paper';
import { WebView } from 'react-native-webview';

export default function Temperature({ navigation }) {

  const pressHandler = () => {
    navigation.goBack();
  }

  const Light = () => {
      navigation.replace('Light')
  }

  const AirQuality = () => {
      navigation.replace('AirQuality')
  }

  return (
    <>
    {/*<WebView source={{ uri: 'https://thingspeak.com/channels/1548631/charts/1?bgcolor=%23ffffff&color=%23d62020&dynamic=true&results=60&type=line&update=15' }} />
    */}<View>
       Temperature sensor
       <WebView
          scalesPageToFit={true}
          bounces={false}
          javaScriptEnabled
          style={{ height: 500, width: 300 }}
          source={{
            html: `
                  <!DOCTYPE html>
                  <html>
                    <head></head> // <--add header styles if needed
                    <body>
                      <div id="baseDiv">https://google.com</div> //<--- add your iframe here
                    </body>
                  </html>
            `,
          }}
          automaticallyAdjustContentInsets={false}
         />
     </View>
     <View style={{flex: 1}}>
       <View style={{flexDirection:"row", height: 50, position: 'absolute', bottom: 30}}>
         <View style={{flex:1}}>
           <IconButton icon="brightness-6" size={50} onPress={Light}/>
         </View>
         <View style={{flex:1}}>
           <IconButton icon="air-filter" size={50} onPress={AirQuality}/>
         </View>
       </View>
     </View>
  </>
  );
}
